import React from 'react';
import { StyledCard } from './styles/Card.styled';


export default function Card(props) {
    console.log(props.id)
    return(
        <StyledCard>
            <div>
            <h2>{props.id}</h2>
                <h2>{props.title}</h2>
                <p>{props.body}</p> 

            </div>

            <div>
                <img src={`./images/${props.image}`} alt="card-imge"></img>
            </div>
        
        </StyledCard>
    )
}
